CREATE DATABASE BlackBeanSkinDB;
USE BlackBeanSkinDB;

-- Create table: 會員資料表 (Member Data Table)
CREATE TABLE MemberData (
                            memberid INT PRIMARY KEY IDENTITY(1,1),
                            username VARCHAR(50),
                            gender VARCHAR(10),
                            birthdate DATE,
                            phone VARCHAR(20),
							passwd NVARCHAR(50)
                            email VARCHAR(100),
                            membercreationdate DATE,
                            country VARCHAR(50),
                            city VARCHAR(50),
                            region VARCHAR(50),
                            street VARCHAR(100),
                            postalcode VARCHAR(20)
);

-- Create table: 商品分類資料表 (Product Category Data Table)
CREATE TABLE ProductCategoryData (
                                     categoryid INT PRIMARY KEY IDENTITY(1,1),
                                     categoryname VARCHAR(50),
                                     parentcategoryid INT
);

-- Create table: 商品基本資料表 (Product Basic Data Table)
CREATE TABLE ProductBasicData (
                                  productid INT PRIMARY KEY IDENTITY(1,1),
                                  sellermemberid INT,
                                  productname VARCHAR(100),
                                  price DECIMAL(10, 2),
                                  specialprice DECIMAL(10, 2),
                                  categoryid INT,
                                  productdetailid INT,
                                  quantity INT,
                                  description NVARCHAR(400),
                                  FOREIGN KEY (sellermemberid) REFERENCES MemberData(memberid),
                                  FOREIGN KEY (categoryid) REFERENCES ProductCategoryData(categoryid)
);



